Associated Objects 通过以下三个函数可以进行关联对象的相关操作： void objc_setAssociatedObject(id object, const void *key, id value, objc_AssociationPolicy policy);
id objc_getAssociatedObject(id object, const void *key);
void objc_removeAssociatedObjects(id object); key 应该是常量的，唯一的，在 setter 和 getter 方法中可以进行访问： static char kAssociatedObjectKey; objc_getAssociatedObject(self, &kAssociatedObjectKey); 但是由于 selector 是唯一的，所以可以直接使用 selector ： https://twitter.com/bbum/status/3609098005 不要调用 objc_removeAssociatedObjects 来移除关联对象，因为会移除所有关联对象。正确的做法是调用 objc_setAssociatedObject 方法并传入 nil 来清除关联。 比起其他解决问题的方法，关联对象应该被视为最后的选择（事实上关联对象也不应该作为首选方法）。

