} 第三个参数表示是否为 required ，如果从 required 中获取不到对应的 objc_method_description ，再从 optional 中获取： Apple Developer Documentation 从 Block 中获取方法签名，虽然苹果没有提供公开的 API 给开发者获取，但是可以通过自定义一个与 Block 结构相同的 struct ，通过这个 struct 来获取方法签名： // Block internals.
typedef NS_OPTIONS(int, TBVBlockFlags) { TBVBlockFlagsHasCopyDisposeHelpers = (1 << 25), TBVBlockFlagsHasSignature = (1 << 30)
};
typedef struct tbv_block { __unused Class isa; TBVBlockFlags flags; __unused int reserved; void (__unused *invoke)(struct tbv_block *block, ...); struct { unsigned long int reserved; unsigned long int size; // requires TBVBlockFlagsHasCopyDisposeHelpers void (*copy)(void *dst, const void *src); void (*dispose)(const void *); // requires TBVBlockFlagsHasSignature const char *signature; const char *layout; } *descriptor; // imported variables
} *TBVBlockRef; // 使用自定义的 TBVBlockRef 获取 descriptor
static NSMethodSignature *tbv_signatureForBlock(id block) { TBVBlockRef layout = (__bridge TBVBlockRef)(block); // 没有签名，直接返回空 if (!(layout->flags & TBVBlockFlagsHasSignature)) { return nil; } // 获取 descriptor 指针 void *desc = layout->descriptor; // 跳过 reserved 和 size 成员 desc += 2 * sizeof(unsigned long int); // 如果有 Helpers 函数， 跳过 copy 和 dispose 成员 if (layout->flags & TBVBlockFlagsHasCopyDisposeHelpers) { desc += 2 * sizeof(void *); } // desc 为 signature 指针的地址，转换下给 objcTypes char *objcTypes = (*(char **)desc); return [NSMethodSignature signatureWithObjCTypes:objcTypes];
} 为了确保 Block 和方法两者的参数是相同的，需要对两者的签名进行匹配，即检验返回值类型和参数类型是否相同： static BOOL tbv_isCompatibleBlockSignature(NSMethodSignature *blockSignature, NSMethodSignature *methodSignature) { NSCParameterAssert(blockSignature); NSCParameterAssert(methodSignature); if ([blockSignature isEqual:methodSignature]) { return YES; } // block 参数个数需要小于 method 的参数个数 (针对 block 调用替换 method 调用) // 两者返回类型需要一致 if (blockSignature.numberOfArguments >= methodSignature.numberOfArguments || blockSignature.methodReturnType[0] != methodSignature.methodReturnType[0]) { return NO; } // 参数类型需要一致 BOOL compatibleSignature = YES; // 自定义参数从第二个开始 for (int idx = 2; idx < blockSignature.numberOfArguments; idx++) { // block 相比 method ，默认参数少了 SEL // method: id(@) SEL(:) .... // block: block(@?) .... const char *methodArgument = [methodSignature getArgumentTypeAtIndex:idx]; const char *blockArgument = [blockSignature getArgumentTypeAtIndex:idx - 1]; if (!methodArgument || !blockArgument || methodArgument[0] != blockArgument[0]) { compatibleSignature = NO; break; } } return compatibleSignature;
