{ // __block fakery void *forwarding; int flags; //refcount; int size; void (*byref_keep)(struct _block_byref_block *dst, struct _block_byref_block *src); void (*byref_dispose)(struct _block_byref_block *); void *captured[16];
} 在获取强引用对象索引的实现中，会在自动释放迟中执行 dispose_helper(obj) 方法，给每个 强引用对象对应的 FBBlockStrongRelationDetector 发送 release 消息，这样就可以拿到它们的索引值，从而获取对应的对象。 static NSIndexSet *_GetBlockStrongLayout(void *block) { ... void (*dispose_helper)(void *src) = blockLiteral->descriptor->dispose_helper; const size_t ptrSize = sizeof(void *); const size_t elements = (blockLiteral->descriptor->size + ptrSize - 1) / ptrSize; void *obj[elements]; void *detectors[elements]; for (size_t i = 0; i < elements; ++i) { FBBlockStrongRelationDetector *detector = [FBBlockStrongRelationDetector new]; obj[i] = detectors[i] = detector; } @autoreleasepool { dispose_helper(obj); } NSMutableIndexSet *layout = [NSMutableIndexSet indexSet]; for (size_t i = 0; i < elements; ++i) { FBBlockStrongRelationDetector *detector = (FBBlockStrongRelationDetector *)(detectors[i]); if (detector.isStrong) { [layout addIndex:i]; } [detector trueRelease]; } return layout;
