- (void)forwardInvocation:(NSInvocation *)inv; 先调用 methodSignatureForSelector: 方法来返回 NSMethodSignature ， NSMethodSignature 用于生成 NSInvocation ，而 NSInvocation 包含了 Target ， SEL ，所有参数和返回值，它以对象的形式对消息进行了一层封装。然后就会调用 forwardInvocation: 对 NSInvocation 进行处理。 NSInvocation 非常灵活，返回值，处理对象，参数和 SEL 都可以进行改变。下面是一个非常简单的例子，假设我们想给 NSArray 添加一个这样的特性：当给 NSArray 发送消息时，如果 NSArray 无法响应，就查找它里面的元素，找出可以响应的对象并进行发送。 @implementation NSArray (ForwardingIteration) - (NSMethodSignature *)methodSignatureForSelector:(SEL)sel
{ NSMethodSignature *sig = [super methodSignatureForSelector:sel]; if(!sig) { for(id obj in self) if((sig = [obj methodSignatureForSelector:sel])) break; } return sig;
} - (void)forwardInvocation:(NSInvocation *)inv
{ for(id obj in self) [inv invokeWithTarget:obj];
} @end 以上三个流程，性能递减，灵活性递增，可以根据具体需求在对应的流程中进行处理。

