draveness/analyze 黑幕背后的Autorelease 整个 iOS 的入口都是放到 @autoreleasepool 的 block 中： int main(int argc, char * argv[]) { @autoreleasepool { return UIApplicationMain(argc, argv, nil, NSStringFromClass([AppDelegate class])); }
} 然后编译器会将其改写成下面的代码： void *context = objc_autoreleasePoolPush();
// {}中的代码
objc_autoreleasePoolPop(context); 我们也可以通过手动调用 @autoreleasepool 来创建自己的自动释放池。 RunLoop 每次处理事件时也会创建和释放 autoreleasepool 。App 启动后，会在主线程的 RunLoop 里注册两个 autoreleasepool 相关的 Observer ，其回调的方法都是 _wrapRunLoopWithAutoreleasePoolHandler() 。 第一个 Observer 监听的事件是 Entry ，即将进入 Loop ，会调用 _objc_autoreleasePoolPush() 来创建自动释放池，order 是 -2147483647 ，优先级最高，确保自动释放池的创建在其它回调之前； 第二个 Observer 监听了 BeforeWaiting 事件，当处理完事件即将进入休眠时调用，会调用 _objc_autoreleasePoolPop() 来释放自动释放池，order 是 2147483647 ，优先级最低，确保自动释放池的释放在所有回调之后，同时也会调用 _objc_autoreleasePoolPush() 来创建一个新的自动释放池，以供下一次唤醒使用； void *objc_autoreleasePoolPush(void) { return AutoreleasePoolPage::push();
} void objc_autoreleasePoolPop(void *ctxt) { AutoreleasePoolPage::pop(ctxt);
} AutoreleasePage 的定义如下： class AutoreleasePoolPage { magic_t const magic; id *next; pthread_t const thread; AutoreleasePoolPage * const parent; AutoreleasePoolPage *child; uint32_t const depth; uint32_t hiwat;
}; 自动释放池是由一系列的 AutoreleasePoolPage 组成，每个 AutoreleasePoolPage 的大小都是 4096 bit 大小。 自动释放池是由 AutoreleasePoolPage 以双向链表的方式实现的 当对象调用 autorelease 方法时，会将对象加入 AutoreleasePoolPage 的栈中 调用 AutoreleasePoolPage::pop 方法会向栈中的对象发送 release 消息 当使用容器的 block 枚举时，内部会自动添加一个 AutoreleasePool ： [array enumerateObjectsUsingBlock:^(id obj, NSUInteger idx, BOOL *stop) { // 这里被一个局部@autoreleasepool包围着
}]; 但是普通的 for 循环和 for in 循环中是没有的，所以当遍历中的 autorelease 变量所占用的内存较大时，需要手动添加 @autoreleasepool 。

