内存管理（二）Tagged Pointer iOS - 老生常谈内存管理（五）：Tagged Pointer 由于内存对齐的关系，指针的值最后四位都是 0 ，所以可以使用这四位来做一些记录。如果最后一位是 1 ，则这个指针是 Tagged Pointer 。 static inline bool _objc_isTaggedPointer(const void *ptr) { return ((intptr_t)ptr & _OBJC_TAG_MASK) == _OBJC_TAG_MASK;
} #if OBJC_MSB_TAGGED_POINTERS
# define _OBJC_TAG_MASK (1ULL<<63)
#else
# define _OBJC_TAG_MASK 1
#endif #if TARGET_OS_OSX && __x86_64__ // 64-bit Mac - tag bit is LSB
# define OBJC_MSB_TAGGED_POINTERS 0
#else // Everything else - tag bit is MSB
# define OBJC_MSB_TAGGED_POINTERS 1
#endif 在 iOS 平台上使用的是最高位进行判断，在 macOS 上 使用的是最低位。 Tagged Pointer 支持的类型： enum
{ OBJC_TAG_NSAtom = 0, OBJC_TAG_1 = 1, OBJC_TAG_NSString = 2, OBJC_TAG_NSNumber = 3, OBJC_TAG_NSIndexPath = 4, OBJC_TAG_NSManagedObjectID = 5, OBJC_TAG_NSDate = 6, OBJC_TAG_RESERVED_7 = 7, OBJC_TAG_First60BitPayload = 0, OBJC_TAG_Last60BitPayload = 6, OBJC_TAG_First52BitPayload = 8, OBJC_TAG_Last52BitPayload = 263, OBJC_TAG_RESERVED_264 = 264
}; Tagged Pointer 不是真的对象，没有 isa 指针，不存在 retain ， release ， autorelease 等对象生命周期管理的流程，其引用计数为 NSUInteger 的最大值。 dispatch_queue_t queue = dispatch_queue_create("parallel", DISPATCH_QUEUE_CONCURRENT);
