NSString *b = [[a mutableCopy] copy];
NSLog(@"%p %p %@", a, b, object_getClass(b)); 常量字符串不会被存储为 Tagged Pointer ，因为常量字符串必须保证可以兼容不同的系统，但是 Tagged Pointer 的内部实现细节却不能保证兼容不同的系统，常量字符串嵌入到二进制字符串时有可能会崩溃； 先执行 [a mutableCopy] ，因 copy 返回的是不可变的字符串，所以常量字符串的 copy 得到的还是原来的常量字符串，所以先通过 mutableCopy 生成一个新的可变字符串，然后再通过 copy 得到一个不可变的 Tagged Pointer ， Tagged Pointer 只会在运行时创建。 输出结果如下： 0x10ba41038 0x6115 NSTaggedPointerString 首先第一个 a 不是 Tagged Pointer ，是一个对象的指针，第二个是 Tagged Pointer。 然后 NSString 对应的 Tagged Pointer 使用的是 ASCII 编码，占用的长度较少。 伪代码： unsigned short -[NSTaggedPointerString characterAtIndex:](void * self, void * _cmd, unsigned long long index) { int8_t buffer[11]; length = self >> 0x4 & 0xf; if (length >= 0x8) { stringData = self >> 0x8; table = "eilotrm.apdnsIc ufkMShjTRxgC4013bDNvwyUL2O856P-B79AFKEWV_zGJ/HYX"; cursor = length; if (length < 0xa) { do { buffer[cursor - 1] = table[stringData & 0x3f]; cursor = cursor - 0x1; stringData = stringData >> 0x6; } while (cursor != 0x0); } else { do { buffer[cursor - 1] = table[stringData & 0x1f]; cursor = cursor - 0x1; stringData = stringData >> 0x5; } while (cursor != 0x0); } } else { *(uint64_t *)buffer = self >> 8; } if (length <= index) { rbx = r8; ___CFExceptionProem(self, _cmd); [NSException raise:@"NSRangeException" format:@"%@: Index %lu out of bounds; string length %lu"]; r8 = rbx; } rax = buffer[index]; return rax; } 长度小于 8 的情况下，直接使用 ASCII 编码，所以 self 按位编译后直接赋值给 buff 即可； 长度大于等于8小于10，就会取出 stringData 的最低 6 位，作为 table 的索引取出相应的值拷贝到 buffer 中，然后将 stringData 右移 6 位，重复操作； 如果大于等于 10 ，那么就会使用 5 位编码，而 table 只使用前半部分。 构造 NSString Tagged Pointer 的原理大致上也和上面的一致。 6 位编码表： eilotrm.apdnsIc ufkMShjTRxgC4013bDNvwyUL2O856P-B79AFKEWV_zGJ/HYX 猜测是按照在英语中出现的频率进行排序，使得尽量多的字符串可以使用 Tagged Pointer 。通过一个简单又巧妙的查找表方式在有限的空间内存储尽量的数据。

