Objective-C weak 弱引用实现 作者在文中提供了一个简单版的 weak 实现： // { 对象地址 : [ 对象指针地址1、 对象指针地址1] }
static NSMutableDictionary *weakTable;
@interface A : NSObject
@end
@implementation A
- (void)dealloc { // 获取指向此对象的所有指针变量地址 for (NSNumber *ptrPtrNumber in weakTable[@((uintptr_t)self)]) { // 根据指针变量地址，将指针变量置为 nil // 这里就是 w1 置 nil uintptr_t **ptrPtr = (uintptr_t **)[ptrPtrNumber unsignedLongValue]; *ptrPtr = nil; } // 移除和此对象相关的数据 [weakTable removeObjectForKey:@((uintptr_t)self)];
}
@end
int main(int argc, const char * argv[]) { @autoreleasepool { weakTable = @{}.mutableCopy; __unsafe_unretained NSObject *w1; @autoreleasepool { NSObject *obj = [A new]; uintptr_t objAddr = (uintptr_t)obj; w1 = obj; // 将对象地址和需要自动置 nil 的指针变量的地址保存至 map 中 // 使用可变数组方便处理多个需要置 nil 的变量指向 obj weakTable[@(objAddr)] = @[@((uintptr_t)&w1)].mutableCopy; // 即将走出 w1 所在作用域，将 w1 的地址从 map 中清除 [weakTable[@((uintptr_t)w1)] removeObject:@((uintptr_t)&w1)]; } NSLog(@"%@", w1); } return 0;
} 系统的 weak 实现总结如下： 设置 __weak 修饰的变量时， runtime 会生成对应的 entry 结构放入 weak hash table 中，以赋值对象地址生成的 hash 值为 key ，以包装 __weak 修饰的指针变量地址的 entry 为 value ，当赋值对象释放时， runtime 会在目标对象的 dealloc 处理过程中，以对象地址（ self ）为 key 去 weak hash table 查找 entry ，置空 entry 指向的的所有对象指针。 实际上 entry 使用数组保存指针变量地址，当地址数量不大于 4 时，这个数组就是个普通的内置数组，在地址数量大于 4 时，这个数组就会扩充成一个 hash table 。 系统会提供一个 SideTable 来关联对象引用和弱引用表，对于一个对象来说这个结构实例是唯一的。一般来说，objc 2.0 的对象引用计数都会优先保存在 isa 的 extra_rc 位段中，只有超出了存储的限制才会将超出部分保存到对应的 SideTable 中， isa 使用 has_sidetable_rc 标记是否超出限制。 系统的实现需要针对 TaggedPointer 进行特殊处理。 weak_entry_t 使用 union 来进行记录，在 wea 指针数量小于 4 个时可以快速访问。 文章不算很长，但是把创建和销毁流程讲得非常清晰。主要重点在 weak_entry_t 的处理， hash 的计算。

