} struct class_data_bits_t { // Values are the FAST_ flags above. uintptr_t bits; class_rw_t* data() { return (class_rw_t *)(bits & FAST_DATA_MASK); } // ...
} bits 标志位作用： 0 - 1 ， FAST_IS_SWIFT_LEGACY ，是否来自 ABI 预稳定版本的 Swift ； 1 - 2 ， FAST_IS_SWIFT_STABLE ，是否来自 ABI 稳定版本的 Swift ； 2 - 3 ， FAST_HAS_DEFAULT_RR ，类或父类含有默认的持有或引用； 3 - 47 ， FAST_DATA_MASK ，指向 class_rw_t 结构体的指针； 47 - 63 ，字节对齐，填 0 。 class_rw_t 是可读可写， Read-Write ，在运行时会进行调整，而 class_ro_t 是只读的，在编译期已经确定，无法调整。 struct class_rw_t { // Be warned that Symbolication knows the layout of this structure. uint32_t flags; uint32_t version; // 只读表的指针（const：不可修改指针指向内存空间中的数据） const class_ro_t *ro; // 方法、属性、协议信息，可用于运行时动态添加 method_array_t methods; property_array_t properties; protocol_array_t protocols; // ...
}; class_ro_t 在编译时会被动态替换为 class_rw_t ，而 class_rw_t 则会通过指针指向 class_ro_t ： struct class_ro_t { // 标志位 uint32_t flags; uint32_t instanceStart; // 实例大小 uint32_t instanceSize;
#ifdef __LP64__ uint32_t reserved;
#endif const uint8_t * ivarLayout; // 类名 const char * name; method_list_t * baseMethodList; protocol_list_t * baseProtocols; // 成员变量 const ivar_list_t * ivars; const uint8_t * weakIvarLayout; property_list_t *baseProperties; method_list_t *baseMethods() const { return baseMethodList; }
}; 从上面的 class_rw_t 和 class_ro_t 可以看出为什么 Category 不支持添加变量，因为 Category 相关方法和属性是添加到 class_rw_t 中的，而 class_ro_t 表示的示例大小和属性在编译时已经确定了，不支持在运行时进行修改。 基类：

